import React from 'react';
import { Navbar as BSNavbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <BSNavbar bg="light" expand="lg">
      <Container>
        <BSNavbar.Brand as={Link} to="/">TaskManager</BSNavbar.Brand>
        <BSNavbar.Toggle aria-controls="nav" />
        <BSNavbar.Collapse id="nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/tasks">Tasks</Nav.Link>
            <Nav.Link as={Link} to="/create-task">Create Task</Nav.Link>
          </Nav>
          <Nav>
            {/* <Nav.Link as={Link} to="/profile">Profile</Nav.Link> */}
            <Nav.Link as={Link} to="https://eu-north-1u8wcgtv8c.auth.eu-north-1.amazoncognito.com/login/continue?client_id=6thkk9j96oa02djeccritml1gr&redirect_uri=http%3A%2F%2Flocalhost%3A3000&response_type=code&scope=email+openid+profile">Login</Nav.Link>
            <Nav.Link as={Link} to="/signup">Signup</Nav.Link>
          </Nav>
        </BSNavbar.Collapse>
      </Container>
    </BSNavbar>
  );
}
